import './Tile.css'

interface Props{
    key:string;
    isEven:boolean;
    image?:string;
    highlight: boolean;
}

export default function Tile({isEven, image, highlight}:Props){
    return <div className={`tile ${isEven ? 'b_tile' : 'w_tile'}`}> 
                    {image && <div style={{ backgroundImage: `url(${image})` }} className="chess-piece"></div>}
            </div>;
}
